alter table Fran auto_increment = 10001;
alter table Product auto_increment = 20001;
alter table SupplyLog auto_increment = 30001;
alter table OrderLog auto_increment = 40001;
alter table IOLog auto_increment = 50001;
alter table Review auto_increment = 60001;

select * from Fran;
select * from Product;
select * from SupplyLog;
select * from OrderLog;
select * from IOLog;
select * from Review;

select * from OrderLog where orderNo between 40001 and 40050;
select * from OrderLog limit 50 offset 0;
select * from OrderLog limit 50 offset 50;

select A.reviewNo, A.review, P.proNo, P.proName from Product P, (select reviewNo, review, R.orderNo, proNo from Review R join OrderLog O on R.orderNo = O.orderNo) A where P.proNo = A.proNo;

select reviewNo, review, R.orderNo, proNo from Review R join OrderLog O on R.orderNo = O.orderNo;





